import './App.css';
import React from 'react'
import {BrowserRouter, Route, Routes} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <h1>Good luck!</h1>
      <BrowserRouter >
      <Routes>
        <Route path='/' element={<VendingMachine />} />
        <Route path='/water' element={<Water />} />
        <Route path='/tea' element={<Tea />} />
        <Route path='/soda' element={<Soda />} />
      </ Routes>
    </ BrowserRouter >
    </div>
  );
}

export default App;
